    "2016-10-29T19:05:41.033741",nt"name": "agreement-workflow-tool-awt",nt"isopen":
    true,nt"url": null,nt"notes": "The Agreement Workflow Tool (AWT) is a role-based
    Intranet application used for processing SSA's Reimbursable Agreements according
    to SSA's standards. AWT provides project coordinators with the functionality to
    create a cost estimate, SSA-1033, and store multiple versions for use in subsequent
    workflows. AWT also provides project coordinators with functionality to Create,
    Renew and Amend the SSA-1235 and SSA-40 Financial Documents. The application also
    provides functionality to generate agreement related reports, to search for an agreement,
    to view agreement history and to store agreement related documentation. AWT interfaces
    with  social SSN Verification (CBSV) to ensure that the external CBSV customers
    have active agreements with SSA. AWT also interfaces with the Data Exchange Inventory
    (DEXI) application to update the data exchange inventory information and provide
    SSA users with a link to the reimbursable agreement documentation.  AWT provides
    the Regional Office Data Exchange Coordinators (DECs) with the ability to create
    and modify tracking records for the non-reimbursable agreements between SSA and
    the States or State Agencies.  AWT is developed with ColdFusion and DB2. Users of
    AWT include DCS, DCO (including the Regional Offices), OGC, DCBFQM, OCO, and ODX.",nt"license_title":
